import logo from './logo.svg'
import './App.css'
import Home from './pages/Home.js'
import EnterNum from './components/EnterNum.js'


function App() {
  return (
    <div className="App">
      <Routes>
        <Route path='/' element={<Home/>}/>
      </Routes>
      <Home/>
    </div>
    )
}

export default App;
